import { useNavigate } from "react-router-dom";
import CreateTodo from "../components/CreateTodo";
import GetTodos from "../components/GetTodos";

const Wrapper = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  height: 100vh;
  h1 {
    margin-bottom: 2rem;
  }
  form {
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    margin-bottom: 1rem;
    input {
      width: 20rem;
      height: 2rem;
      margin-bottom: 1rem;
    }
    button {
      width: 20rem;
      height: 2rem;
    }
  }
  div {
    span {
      cursor: pointer;
      color: rgb(88, 167, 255);
    }
  }
`;

function Todo({ token }) {
  const navigate = useNavigate();

  if (!token) navigate("/");
  return (
    <>
      <Wrapper>
        <h1>Todo</h1>
        <CreateTodo />
        <GetTodos />
      </Wrapper>
    </>
  );
}

export default Todo;
